import React from "react";

import "./address-card.styles.css";

const AddressCard = ({ addressData }) => {
  const {
    data: {
      name,
      phone,
      nameStreet,
      numberStreet,
      city,
      zipCode,
      country,
      state,
    },
  } = addressData;
  console.log("ADREES CARD", addressData);
  return (
    <div className="addressCard__container">
      <div className="addressCard__subContainer">
        <strong>{name}</strong>
        <span>
          {nameStreet} {numberStreet}
        </span>
        <div></div>
        <span>
          {city}
          {""}
          {state.label}
          {""}
          {zipCode}
        </span>
        <span>{country.label}</span>
        <span>{phone}</span>
        <button>Delivery this address</button>

        <button>Remove</button>
      </div>
    </div>
  );
};

export default AddressCard;
